import React, { useEffect, useState } from 'react';
import { fetchData } from '../api';

const CategorizedData = ({ endpoint }) => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const getData = async () => {
      try {
        const result = await fetchData(endpoint);
        setData(result); // Store the fetched data
      } catch (err) {
        setError(err.message);
      }
    };
    getData();
  }, [endpoint]);

  if (error) return <p>Error: {error}</p>;
  if (!data) return <p>Loading...</p>;

  return (
    <div>
      <h2>{endpoint.charAt(0).toUpperCase() + endpoint.slice(1)} Data</h2>
      <DataTable data={data} />
    </div>
  );
};

const DataTable = ({ data }) => {
  // Ensure data is an array of objects
  const items = Array.isArray(data) ? data : Object.values(data);

  // Extract table headers dynamically
  const tableHeaders = items.length > 0 ? Object.keys(items[0]) : [];

  return (
    <table border="1" cellPadding="5" cellSpacing="0" style={{ width: '100%', textAlign: 'left' }}>
      <thead>
        <tr>
          {tableHeaders.map((header, index) => (
            <th key={index}>{header}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {items.map((row, rowIndex) => (
          <tr key={rowIndex}>
            {tableHeaders.map((header, colIndex) => (
              <td key={colIndex}>
                {/* Check if the value is an object or array */}
                {typeof row[header] === 'object' ? JSON.stringify(row[header]) : row[header]}
              </td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};


export default CategorizedData;
